  if (!vm) {
    vm = createVM<ProfileCompletionPopupProps>(AuthExpireConstruct, props, appContext)
  }
  vm!.exposed!.visible.value = true
  // 全局通知，便于其他后续逻辑控制
  mitt.emit('global-notification', { type: 'AuthExpire', value: true })
